import './App.css';
import Image from "./components/Image"
import Sign from "./components/Sign"
import Show from './components/Show';
import { useState } from 'react';
function App() {

  const [url,seturl]=useState(' ');
  function imageurl(data){
    // console.log(data);
    seturl(data);
  }
  // console.log("url",url);
  return (
    <div className="App">
       <Sign url={url}/>
       <Image imageurl={imageurl}/>
       <Show url={url}/>
    </div>
  );
}

export default App;
